import { darkTheme } from '../theme';
import { AppBar, Toolbar, Container, Box, Typography, Button, IconButton, makeStyles, Link } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';

const useStyles = makeStyles({
    nav: {
        backgroundColor: darkTheme.palette.background.paper,
    },

    navBox: {
        flexGrow: "1",
        display: "flex",
        justifyContent: "center",
        alignContent: "center",
    },
    
    navButton: {
        margin: "0.5rem",
        borderRadius: "0",
        borderBottomColor: darkTheme.palette.text.primary,
        borderBottom: "3px solid",
        textDecoration: "none",

        "&:hover": {
            textDecoration: "none",
            borderBottom: "thick solid #0000FF",
        },
    },
  })

const Navbar = () => {
    const classes = useStyles();

    return (
        // center navtabs
        <AppBar className={classes.nav} position="fixed">
            <Box className={classes.navBox}>
                <Toolbar>
                    
                    <Container >
                        <Button className={classes.navButton} component={Link} href="#home">
                            <Typography variant="body1">
                                Home
                            </Typography>
                        </Button>
                        <Button className={classes.navButton} component={Link} href="#aboutMe">
                            <Typography variant="body1">
                                About me
                            </Typography></Button>
                    </Container>

                    {/* <IconButton edge="end" aria-label="menu">
                        <MenuIcon />
                    </IconButton> */}
                    
                </Toolbar>
            </Box>
        </AppBar>
    )
}

export default Navbar
